import "./components/css/styles.scss";
import { Link, Route, Routes, useNavigate } from "react-router-dom"; //BrowserRouter isn't required because it exists in index.js
import HomePage from "./components/uniComponents/HomePage";
import ViewAppointment from "./components/uniComponents/ViewAppointment";
import Header from "./components/uniComponents/Header";
import Footer from "./components/uniComponents/Footer";
import Login from "./components/uniComponents/Login";
import Registration from "./components/patComponents/Registration";
import CreateAppointment from "./components/uniComponents/CreateAppointment";
import UserButton from "./components/uniComponents/choiceComponents/UserButton";
import ViewMedRecord from "./components/patComponents/ViewMedRecord";
import PatientRecords from "./components/uniComponents/PatientRecords";
import UserChoice from "./components/uniComponents/choiceComponents/UserChoice";
import { useState } from "react";

/*

These 3 constants, header links, labels and routes are all used for navigration, if you edit an index of one you are required to edit the same index of the rest.
For example: if index 1 of links is to login, then index 1 of labels must display a Login label, and index 1 of routes must route to a login component.

*/

let headerLinks: string[] = [];
let headerLabels: string[] = [];
let headerRoutes: React.ReactElement[] = [];

/*

const headerLinks = ["/", "/login", "/reg", "/viewApp", "/createApp"]; //This array contains the paths to elements
const headerLabels = [
  "Home",
  "Login",
  "Registration",
  "View and Cancel Appointments",
  "Create Appointment",
]; //This array contains the labels of the header links
const headerRoutes: React.ReactElement[] = [
  <HomePage />,
  <Login />,
  <Registration />,
  <ViewAppointment />,
  <CreateAppointment />,
]; //This array contains the elements to be routed to

*/

let routeCreator: React.ReactElement[] = []; //This is array is used to store our route componenets, which are later put on the site

function App() {
  interface Temp {
    linkState: string[];
    labelState: string[];
    routerState: React.ReactElement[];
  }

  const [header, setHeader] = useState<Temp>({
    linkState: headerLinks,
    labelState: headerLabels,
    routerState: headerRoutes,
  });

  const createFinalRoutes = () => {
    //This if statement generates the amount of routes required based on the amount of labels and links to page components.
    console.log("!");
    setHeader({
      linkState: headerLinks,
      labelState: headerLabels,
      routerState: headerRoutes,
    });

    if (headerLinks.length > 0 && headerLabels.length > 0) {
      for (let i = 0; i < headerLinks.length; i++) {
        routeCreator.push(
          <Route path={header.linkState[i]} element={header.routerState[i]} />
        );
      }
    }

    console.log(header.linkState);
    console.log(1);

    return <Header links={header.linkState} labels={header.labelState} />;
  };

  const createLinks = (links: string[]) => {
    for (let i = 0; i < links.length; i++) {
      headerLinks.push(links[i]);
    }
  };

  const createLabels = (labels: string[]) => {
    for (let i = 0; i < labels.length; i++) {
      headerLabels.push(labels[i]);
    }
  };

  const createRoutes = (routes: React.ReactElement[]) => {
    for (let i = 0; i < routes.length; i++) {
      headerRoutes.push(routes[i]);
    }
    setLoginIsVisible(false);
    setBackIsVisible(true);
  };

  //This is intended to handle the user choice
  const [loginIsVisible, setLoginIsVisible] = useState<boolean>(true);
  const [backIsVisible, setBackIsVisible] = useState<boolean>(false);
  const [message, setMessage] = useState("");

  //useNavigate is used to keep the user's URL on the correct page each time they use the buttons.
  const navigate = useNavigate();

  const handleNavigation = (input: string) => {
    setMessage(input);
    //setLoginIsVisible(false);

    navigate("/");
  };

  return (
    <>
      <div id="header">
        <Header links={header.linkState} labels={header.labelState} />
      </div>

      <div className="govuk-width-container app-width-container" id="body">
        {/* Back Button */}
        {backIsVisible && (
          <a onClick={() => navigate(-1)} className="govuk-back-link">
            Back
          </a>
        )}

        <Routes>{routeCreator};</Routes>

        {(() => {
          switch (message) {
            case "Patient":
              return (
                <div onClick={createFinalRoutes}>
                  {loginIsVisible && (
                    <Login
                      userType="Patient"
                      passLabels={createLabels}
                      passLinks={createLinks}
                      passRoutes={createRoutes}
                      onClick={createFinalRoutes}
                    />
                  )}
                </div>
              );
            case "Doctor":
              return (
                <div onClick={createFinalRoutes}>
                  {loginIsVisible && (
                    <Login
                      userType="Doctor"
                      passLabels={createLabels}
                      passLinks={createLinks}
                      passRoutes={createRoutes}
                      onClick={createFinalRoutes}
                    />
                  )}
                </div>
              );
            case "Admin":
              return (
                <div onClick={createFinalRoutes}>
                  {loginIsVisible && (
                    <Login
                      userType="Admin"
                      passLabels={createLabels}
                      passLinks={createLinks}
                      passRoutes={createRoutes}
                      onClick={createFinalRoutes}
                    />
                  )}
                </div>
              );
            default:
              return <UserChoice onButClick={handleNavigation} />;
          }
        })()}
      </div>
      <div id="footer">
        <Footer />
      </div>
      <script src="/govuk-frontend/all.js"></script>
    </>
  );
}

export default App;
